-- Users table
CREATE TABLE IF NOT EXISTS users (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  username TEXT UNIQUE NOT NULL,
  password_hash TEXT NOT NULL,
  email TEXT,
  name TEXT,
  profile_image TEXT,
  is_admin BOOLEAN DEFAULT FALSE,
  created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  last_login DATETIME,
  settings JSON DEFAULT '{}' -- Store user-specific settings (e.g., notifications, dark mode)
);

-- Modules table (global module definitions)
CREATE TABLE IF NOT EXISTS modules (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  name TEXT UNIQUE NOT NULL,
  description TEXT,
  type TEXT NOT NULL, -- e.g., 'instagram', 'youtube', 'email'
  is_active BOOLEAN DEFAULT FALSE, -- Global module status (can be activated/deactivated by admin)
  config JSON DEFAULT '{}', -- Default configuration for the module
  created_at DATETIME DEFAULT CURRENT_TIMESTAMP
);

-- User-Module permissions and configurations (per user module settings)
CREATE TABLE IF NOT EXISTS user_modules (
  user_id INTEGER,
  module_id INTEGER,
  is_active BOOLEAN DEFAULT FALSE, -- User-specific activation status for a module
  config JSON DEFAULT '{}', -- User-specific configuration for a module
  granted_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  FOREIGN KEY (user_id) REFERENCES users (id) ON DELETE CASCADE,
  FOREIGN KEY (module_id) REFERENCES modules (id) ON DELETE CASCADE,
  PRIMARY KEY (user_id, module_id)
);

-- Activity Logs (more detailed logging)
CREATE TABLE IF NOT EXISTS activity_logs (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  user_id INTEGER NOT NULL,
  module_type TEXT NOT NULL, -- e.g., 'auth', 'instagram', 'youtube', 'system'
  action TEXT NOT NULL,      -- e.g., 'login', 'logout', 'account_connected', 'content_generated', 'module_toggle'
  status TEXT NOT NULL,      -- 'success', 'error', 'info', 'warning'
  message TEXT,
  metadata JSON DEFAULT '{}', -- Store additional data like IP, user_agent, device_info, is_suspicious, is_trusted
  created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  FOREIGN KEY (user_id) REFERENCES users (id) ON DELETE CASCADE
);

-- Instagram Accounts (connected accounts)
CREATE TABLE IF NOT EXISTS instagram_accounts (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  user_id INTEGER NOT NULL,
  username TEXT NOT NULL,
  access_token TEXT, -- In a real app, this would be encrypted
  refresh_token TEXT, -- In a real app, this would be encrypted
  account_id TEXT, -- Instagram's internal account ID
  is_connected BOOLEAN DEFAULT FALSE,
  followers_count INTEGER DEFAULT 0,
  following_count INTEGER DEFAULT 0,
  posts_count INTEGER DEFAULT 0,
  last_sync DATETIME,
  created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  UNIQUE (user_id, username),
  FOREIGN KEY (user_id) REFERENCES users (id) ON DELETE CASCADE
);

-- Instagram Automation Configurations (per account automation settings)
CREATE TABLE IF NOT EXISTS instagram_automation (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  user_id INTEGER NOT NULL,
  account_id INTEGER NOT NULL,
  auto_generate_content BOOLEAN DEFAULT FALSE,
  require_approval BOOLEAN DEFAULT TRUE,
  topics TEXT, -- Comma-separated topics for AI generation
  post_times JSON DEFAULT '[]', -- Array of specific times (e.g., ["09:00", "15:30"])
  posts_per_day INTEGER DEFAULT 1,
  is_active BOOLEAN DEFAULT FALSE, -- Whether the automation is currently running
  last_run DATETIME,
  next_run DATETIME,
  created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  updated_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  FOREIGN KEY (user_id) REFERENCES users (id) ON DELETE CASCADE,
  FOREIGN KEY (account_id) REFERENCES instagram_accounts (id) ON DELETE CASCADE,
  UNIQUE (user_id, account_id)
);

-- Instagram Posts (generated/scheduled posts)
CREATE TABLE IF NOT EXISTS instagram_posts (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  user_id INTEGER NOT NULL,
  account_id INTEGER NOT NULL,
  automation_id INTEGER, -- Link to automation config if generated automatically
  content_text TEXT NOT NULL,
  image_url TEXT,
  video_url TEXT,
  hashtags TEXT, -- Comma-separated hashtags
  status TEXT NOT NULL, -- 'pending', 'approved', 'rejected', 'scheduled', 'posted', 'failed'
  scheduled_time DATETIME,
  posted_at DATETIME,
  engagement_data JSON DEFAULT '{}', -- Store likes, comments, etc. after posting
  success_score REAL, -- 0.0 to 1.0, indicating performance
  created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  updated_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  FOREIGN KEY (user_id) REFERENCES users (id) ON DELETE CASCADE,
  FOREIGN KEY (account_id) REFERENCES instagram_accounts (id) ON DELETE CASCADE,
  FOREIGN KEY (automation_id) REFERENCES instagram_automation (id) ON DELETE SET NULL
);

-- Content Approvals (for manual review of AI-generated content)
CREATE TABLE IF NOT EXISTS content_approvals (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  user_id INTEGER NOT NULL,
  account_id INTEGER NOT NULL,
  post_id INTEGER, -- Link to instagram_posts if it's a generated post
  content_type TEXT NOT NULL, -- 'post', 'story', 'reel'
  content_text TEXT NOT NULL,
  hashtags JSON DEFAULT '[]',
  image_url TEXT,
  video_url TEXT,
  scheduled_time DATETIME,
  status TEXT NOT NULL, -- 'pending', 'approved', 'rejected', 'posted'
  created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  approved_at DATETIME,
  approved_by INTEGER,
  rejection_reason TEXT,
  FOREIGN KEY (user_id) REFERENCES users (id) ON DELETE CASCADE,
  FOREIGN KEY (account_id) REFERENCES instagram_accounts (id) ON DELETE CASCADE,
  FOREIGN KEY (post_id) REFERENCES instagram_posts (id) ON DELETE SET NULL,
  FOREIGN KEY (approved_by) REFERENCES users (id) ON DELETE SET NULL
);

